import { useMutation } from "@apollo/client";
import { Box, Button, TextField, Typography } from "@mui/material"
import { ADDCREDENTIAL } from "../graphql";
import AddCredential from "./AddCredential";

const RequestCredential = (props:any) => {

    const [requestCredential,{loading,error}] = useMutation(ADDCREDENTIAL);

    return (
        <Box>
            <Typography variant="h4">Request credential from user</Typography>
            <Box component="form" noValidate sx={{ mt:1 }} onSubmit={()=>{}}>
                <TextField
                margin="normal"
                required
                fullWidth
                id = "user_id"
                label = "User Id"
                name = "userId"
                autoComplete="text"
                autoFocus
                />
                <Button 
                type="submit" 
                variant="contained" 
                sx = {{ mt:3, mb:2 }}
                disabled={loading}
                >
                    Submit
                </Button>
            </Box>
        </Box>
    )
}

export default RequestCredential;
